import Layout from '../src/components/Layout';
import { Cookies } from 'react-cookie';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';

//components

const cookies = new Cookies();

const dashboard = () => {
    return (
        <Layout>
            <div className='main'>
                <Container fluid>
                    <Row className='cabecera'>
                        <Row>
                            <div>
                            <img src='https://coreui.io/react/demo/static/media/logo.406a451a.svg'/>
                            </div>
                        </Row>
                    </Row>
                    <Row></Row>
                </Container>
            </div>
            <style global jsx>{`
                *{
                    box-sizing: border-box;
                }
                html,
                body,
                body > div:first-child,
                div#__next,
                div#__next > div,
                div#__next > div > div {
                    height: 100%;
                    margin:0; padding:0;
                }

                .main{
                    border: 1px solid;
                    width: 100%;
                    height: 100%;
                    background: #C2C0C0;
                }

                .cabecera{
                    width: 100%;
                    height: 100%;
                    border: 1px solid;
                }                

            `}</style>
        </Layout>
    );
}

export default dashboard;
